import React, { useState, useEffect, useCallback } from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';
import ModalDocument from './ModalDocument';
import './Documents.css';

function Documents() {
  const [documents, setDocuments] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');
  const [showModal, setShowModal] = useState(false);
  const [selectedDocument, setSelectedDocument] = useState(null);
  const [programDetails, setProgramDetails] = useState(null);
  const navigate = useNavigate();
  const user = JSON.parse(localStorage.getItem('user'));

  const fetchDocuments = useCallback(async () => {
    try {
      console.log('Отправка запроса документов:', { userId: user.id });
      const response = await axios.get(`http://localhost:5000/api/documents`, {
        params: {
          userId: user.id
        }
      });
      console.log('Получены документы:', response.data);
      response.data.forEach((doc, index) => {
        console.log(`Документ ${index + 1}:`, {
            regnumber: doc.regnumber,
            formseries: doc.formseries,
            formnumber: doc.formnumber
        });
      });
      setDocuments(response.data);
      setLoading(false);
    } catch (err) {
      console.error('Ошибка при загрузке документов:', err);
      setError(err.response?.data?.error || 'Ошибка при загрузке документов');
      setLoading(false);
    }
  }, [user.id]);

  useEffect(() => {
    fetchDocuments();
  }, [fetchDocuments]);

  const handleLogout = () => {
    localStorage.removeItem('user');
    navigate('/login');
  };

  const handleBack = () => {
    navigate('/user');
  };

  const handleShowDetails = async (document) => {
    try {
      console.log('Открытие деталей для документа:', document);
      if (!document || !document.ID_ProgDPO) {
        console.error('Ошибка: отсутствует ID_ProgDPO у документа', document);
        return;
      }
      console.log('Отправка запроса для ID_ProgDPO:', document.ID_ProgDPO);
      const response = await axios.get(`http://localhost:5000/api/program-details/${document.ID_ProgDPO}`, {
        params: {
          workerId: user.id
        }
      });
      console.log('Полученные детали программы:', response.data);
      
      setProgramDetails(response.data);
      setSelectedDocument(document);
      setShowModal(true);
    } catch (err) {
      console.error('Ошибка при загрузке деталей программы:', err);
      console.error('Детали ошибки:', err.response?.data || err.message);
    }
  };

  const handleCloseModal = () => {
    setShowModal(false);
    setSelectedDocument(null);
    setProgramDetails(null);
  };

  if (loading) return <div className="loading">Загрузка...</div>;
  if (error) return <div className="error">{error}</div>;

  return (
    <div className="documents-container">
      <div className="documents-header">
        <h1>Мои документы</h1>
        <div className="header-buttons">
          <button onClick={handleBack} className="back-button">Назад</button>
          <button onClick={handleLogout} className="logout-button">Выйти</button>
        </div>
      </div>
      
      <div className="documents-list">
        {documents.length === 0 ? (
          <p className="no-documents">Документы не найдены</p>
        ) : (
          <table className="documents-table">
            <thead>
              <tr>
                <th>Программа</th>
                <th>Организация</th>
                <th>Дата выдачи</th>
                <th>Действия</th>
              </tr>
            </thead>
            <tbody>
              {documents.map((doc) => (
                <tr key={doc.ID_Document}>
                  <td>{doc.ProgramName}</td>
                  <td>{doc.SName}</td>
                  <td>{new Date(doc.DateIssue).toLocaleDateString()}</td>
                  <td>
                    <button 
                      className="details-button"
                      onClick={() => handleShowDetails(doc)}
                    >
                      Подробности
                    </button>
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        )}
      </div>

      {showModal && selectedDocument && (
        <ModalDocument 
          selectedDocument={selectedDocument}
          programDetails={programDetails}
          onClose={handleCloseModal}
        />
      )}
    </div>
  );
}

export default Documents;
